static void mallocForppptr(float*** imageSpace,imageSize spaceSize) 
{
	for (int k = 0; k < spaceSize.dimsc; k++)
	{
		imageSpace[k] = (float**)malloc(spaceSize.rowsc * sizeof(float*));
		while(imageSpace[k] == NULL){
			printf("imageSpace[i] malloc failed\n");
			imageSpace[k] = (float**)malloc(spaceSize.rowsc * sizeof(float*));
		}	
	}
	for (int i = 0; i < spaceSize.dimsc; i++)
		for(int j=0;j<spaceSize.rowsc;j++){
			imageSpace[i][j] = (float*)malloc(spaceSize.colsc * sizeof(float));
			while(imageSpace == NULL){
				printf("imageSpace[j] malloc failed\n");
				imageSpace[i][j] = (float*)malloc(spaceSize.colsc * sizeof(float));
			}
		}
	
}

static void freeForptr(float* imageSpace) {

	// Optimized your 1 level memory allocation code
	free(imageSpace);
}

static void freeForptr_2(float** imageSpace, imageSize spaceSize) {

	// Optimized your 2 level memory allocation code
	
		for (int i = 0; i < spaceSize.rowsc; i++)
		{
			free((void*)imageSpace[i]);
		}
	free(imageSpace);

}




static void freeForptr_3(float*** imageSpace,imageSize spaceSize) 
{
	// Optimized your 3 level memory allocation code
	for (int k = 0; k < spaceSize.dimsc; k++)
	{
		for (int i = 0; i < spaceSize.rowsc; i++)
		{
			
			free((void*)imageSpace[k][i]);	
		}
		free((void*)imageSpace[k]);
	}
	free(imageSpace);
}
static void freeForptr_4(float**** imageSpace, imageSize spaceSize) {
	// Optimized your 4 level memory allocation code
	for (int n = 0; n < spaceSize.numsc; n++) {
	
		for (int d = 0; d < spaceSize.dimsc; d++) {
		
			for (int r = 0; r < spaceSize.rowsc; r++) {
			
				free(imageSpace[n][d][r]);
			
			}
			free(imageSpace[n][d]);
		
		}
		free(imageSpace[n]);
	}
	free(imageSpace);
}
